import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./Home";
import "./App.css";
import Header from "./Header";
import Login from "./Login";
function App() {
  return (
    <div className="app">
      <Router>
        <Routes>
        <Route path="/login" element={<Login />} />
          <Route path="/" element={
            <>
              <Header/>
            <Home />
            </>
            } />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
